import { useSelector } from "react-redux";
import Menu from "../Menu";
import NotificationCenter from "../NotificationCenter";

function PrimaryLayout({ children }) {
const {menu,notificationCenter}=useSelector(state=>({
    menu:state.global.menu,
    notificationCenter:state.global.notificationCenter
    }))

    return (
      <>
        <Navbar />
        <div className='flex mt-15'>
          {menu&&<Menu />}
          {children} {/* This will render the specific route content */}
        </div>
        {notificationCenter
            &&
            <NotificationCenter/>    
        }
      </>
    );
  }

export default PrimaryLayout
